import { Navigate } from "react-router-dom";


const ProtectedRoute = ({component: Component, loggedIn}) => {
  return (
    loggedIn ? <Component {...props} /> : <Navigate to={'/sign-in'} />
  )
}

export default ProtectedRoute;
